    [],nt"num_tags": 12,nt"name": "okefenokee-national-wildlife-refuge-annual-narrative-report-calendar-year-2000",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    NWR and Banks Lake NWR outlines Refuge accomplishments during the 2000 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Information about monitoring and studies-
    including surveys and censuses and studies and investigations- is provided next.
    Habitat restoration and management projects are also covered; activities include
    wetland restoration, water level management, timber management, prescribed burning,
    and vegetation control. Fish and wildlife management are discussed next with emphasis
    on bird banding and animal control. Coordination activities, such as interagency
    coordination and private land activities, are outlined. The resource protection
    section provides an update on law enforcement. Information about public education
    and recreation is given including visitor services and outreach. Finally, comprehensive
    management planning and general administration are discussed in the Refuge planning
    and administration section. Refuge brochures and field guides are attached.",nt"owner_org":
